aphImage\",\"id\":\"1861749425355855309\",\"edge_media_to_caption\":{\"edges\":[{\"node\":{\"text\":\"Heute in der Vergangenheit. \\nDer @fcstpauli ist der etwas andere Klub und mit keiner Vereinskultur habe ich mich jemals so identifiziert wie dem Kiez-Klub. Seit dieser Saison ist mein besonderer Freund Christoph im Trainer-Team f\\u00fcr die Athletik zust\\u00e4ndig und ich habe ihn bei seiner Arbeit mit den Spielern kurz beobachten d\\u00fcrfen. Kein Spieler ist lieber im Kraftraum, als auf dem Feld. Fu\\u00dfballer sind K\\u00fcnstler in meinen Augen, sie wollen die Sch\\u00f6nheit des Spiels in Technik, Kampf, Toren und Bewegung als Spektakel f\\u00fcr die Massen zeigen und sich und ihr Team verwirklichen. Am Ende z\\u00e4hlt das Ergebnis mehr, als der Ausdruck, aber jeder Fu\\u00dfballer hat eine \\u00e4sthetische Idee von dem Umgang mit dem Ball.\\nKein Verein verk\\u00f6rpert die Mentalit\\u00e4t \\u201eYou\\u2018ll never walk alone\\u201c so gnadenlos wie der @fcstpauli und der @liverpoolfc . Bekommst du ein Teil der DNA eines solchen Klubs mit, dann erweitert sich dein Horizont. \\nFORZA ST. PAULI\\n#sanktpauli #hamburg #braunwei\\u00df #fussball #neverquit #morethanaclub\"}}]},\"shortcode\":\"BnWQz0HH5XN\",\"edge_media_to_comment\":{\"count\":0},\"taken_at_timestamp\":1536157848,\"dimensions\":{\"height\":1170,\"width\":1080},\"display_url\":\"https://scontent-frt3-2.cdninstagram.com/vp/c04485c01946f3912b1ee2628d2927f6/5C20BCDB/t51.2885-15/e35/40129185_269034280596805_6252182109449533726_n.jpg?_nc_eui2=AeER-DOrtUSygV3GVKPhUBGIWP5A0axhEJI36xb7aeYFKIyFTtQWCZZVK2NEhJXzgBgowZecFaoKq3j9Sc8HQ9Oh\",\"edge_liked_by\":{\"count\":0},\"edge_media_preview_like\":{\"count\":0},\"owner\":{\"id\":\"293443769\"},\"thumbnail_src\":\"https://scontent-frt3-2.cdninstagram.com/vp/cbf5f37865424634fa12bb11bbfb5b37/5C196D53/t51.2885-15/sh0.08/e35/c0.45.1080.1080/s640x640/40129185_269034280596805_6252182109449533726_n.jpg?_nc_eui2=AeER-DOrtUSygV3GVKPhUBGIWP5A0axhEJI36xb7aeYFKIyFT